export default function TankChars() {
    const tankChars = [
        'D.Va',
        'Doomfist',
        'Junker Queen',
        'Orisa',
        'Ramattra',
        'Reinhardt',
        'Roadhog',
        'Sigma',
        'Winston',
        'Wrecking Ball',
        'Zarya'
    ];

    return (
        <>
        <h3>Tank Characters</h3>
        {tankChars.map((tank, index) => (
            <label key={index}>{tank}</label>
        ))}

        </>
    );
}
